pragma solidity 0.4.18;
import "./Restrictor.sol";
import "../lib/odll/userManager.sol";

contract TreatmentRequestWriter is Restrictor {

  function TreatmentRequestWriter(address _dbAddress) public {
    require(_dbAddress != 0x0);
    dbAddress = _dbAddress;
  }

  // treatment request status: 0 => pending, 1 => has applications, 2 => closed to applications, 3 => finished
  function requestTreatment (
    address dentistId,
    uint scanAppointmentId,
    uint patientScanAppointmentIndexNumber,
    bytes32 treatmentInsurance,
    bytes32[] scanResults,
    bytes32 treatmentComment
  )
    external
    onlyPermittedSmartContract
  {
    userManager.applyForTreatment(dbAddress, dentistId, msg.sender, scanAppointmentId, patientScanAppointmentIndexNumber, treatmentInsurance, scanResults, treatmentComment);
  }

  function cancelTreatmentRequest (
    uint patientTreatmentIndexNumber
  )
    external
    onlyPermittedSmartContract
  {
    userManager.cancelTreatmentRequest(dbAddress, msg.sender, patientTreatmentIndexNumber);
  }
}
